import React from "react";
import './education.css';  

const EducationCard = () => {
    return (
        <div className="innerEd">
            <div className="edText">
                <h3>University of Central Florida</h3>
                <p>Bachelor of Science in Computer Science, Minor in International Engineering</p>
                <p>GPA: 3.93</p>
                <p>Member of the Burnett Honors College</p>
                <p>Recipient of UCF's Provost Scholarship</p>
            </div>
        </div>
    )
}

export default EducationCard;
